import s from './Components/App/app.module.css'
import {BrowserRouter, Route} from 'react-router-dom';
import Header from "./Components/Header/Header";
import HeaderCenter from "./Components/HeaderCenter/HeaderCenter";
import HeaderBottom from "./Components/HeaderBottom/HeaderBottom";
import CenterHeader from "./Components/CenterHeader/CenterHeader";
import PizzaContainer from "./Components/HeaderCenter/Pizza/PizzaContainer";
import SneksContainer from "./Components/HeaderCenter/Sneks/SneksContainer";
import DrinkContainer from "./Components/Drink/DrinkContainer";
import SousContainer from "./Components/HeaderCenter/Sous/SousContainer";


function App(props) {
    return (

        <BrowserRouter>
            <div className={s.App}>
                <Header/>
                <HeaderCenter/>
                <HeaderBottom/>
                <CenterHeader/>
                <Route path="/pizza" render={() => <PizzaContainer
                />}/>
                <Route path="/sneks" render={() => <SneksContainer
                />}/>
                <Route path="/drink" render={() => <DrinkContainer
                />}/>
                <Route path="/sous" render={() => <SousContainer
                />}/>
            </div>
        </BrowserRouter>

    );
}

export default App;
